import React from 'react';
import './styles/App.css';
import {BrowserRouter, Routes, Route} from 'react-router-dom'
import Main from './pages/Main';


function App() {
  return(
    <BrowserRouter>
    <Routes>
      <Route path="/main">
        <Main/>
      </Route>
    </Routes>

    </BrowserRouter>
  )
}

export default App;
